 */
import { shakeKeyframes } from './keyframes/shake.js';
export const AnimationShakeName = 'cds-component-shake';
export const AnimationShakeConfig = [
    {
        target: '.private-host',
        animation: shakeKeyframes,
        options: {
            duration: 1200,
            easing: 'ease-in-out',
            endDelay: 50,
        },
    },
];
//# sourceMappingURL=cds-component-shake.js.map
